import React from 'react';
import "./navbar.css"
import {  Link } from "react-router-dom";
const navbar= () =>{
    return(
        <header class="header">
            <div class="left">
                <a href="#">Management App</a>
            </div>
            <div class="mid">
                <ul class="navbar">
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/Users">Users</Link>
                </li>
                <li>
                    <Link to="/Tasks">Tasks</Link>
                </li>
                </ul>
            </div>

        </header>
    );
}
export default navbar;
